(124, '6.9', 'Cuando un ascensor queda entre pisos o en el túnel, la distancia máxima entre la pisadera de cabina y el muro es mayor a 125 mm.', 'Leve'),
(125, '6.10', 'Presencia de oxidación en cualquier punto del cable del regulador de velocidad y/o cables de compensación, tal que : -Aún no se presenta pérdida de material y/o -Al contacto con el cable se presenta coloración característica de óxido (Ejemplo amarilla o roja).', 'Leve'),
(126, '6.10', 'Presencia de oxidación en cualquier punto del cable del regulador de velocidad, y/o cables de compensación, tal que exista desprendimiento de material o se evidencie la destrucción paulatina de los hilos constitutivos del cable, por acción de agentes externos. ', 'Grave'),
(127, '6.4', 'Cable del limitador deteriorado.', 'Muy Grave'),
(128, '6.4', 'Existen empalmes en los cables.', 'Muy Grave'),
(129, '6.2', 'Existen empalmes en los cables.', 'Muy Grave'),
(130, '6.4', 'Cables con alambres rotos superior a 2 hilos en un metro en el mismo torón.', 'Grave'),
(131, '6.2', 'Cables con alambres rotos según los siguientes criterios: 1-Los hilos rotos superan el 50% de un mismo paso del total de los hilos que conforman el torón. 2-Existen más de 2 hilos rotos por torón en el tramo de un paso del cable.', 'Muy Grave'),
(132, '6.2', 'En casos de cinta de tracción, se presenta al menos una fisura, una grieta, y/o un adelgazamiento de la cubierta en 1.5 m de la cinta.', 'Muy Grave'),
(133, '6.2', 'Diámetro de los cables de tracción inferior al 10% de su diámetro nominal (por desgaste o por defecto de fabricación).', 'Grave'),
(134, '6.2', 'Para ascensores de tracción: 1-Con capacidad mayor a 6 personas la tracción se realiza con menos de tres cables. 2- Con capacidad menor a 6 personas la tracción se realiza con menos de dos cables.', 'Muy Grave'),
(135, '6.2', 'Amarres de cable de tracción en cabina y/o contrapeso desajustado, sueltos carente de amarres o en mal estado (desgaste de pasadores, aprietes,  tuerca, contratuerca, pasadores de aletas, corrosión, etc.)', 'Muy Grave'),
(136, '6.2', 'Mezcla de diferentes tipos de amarres en los cables de tracción en el mismo punto en cabina y/o en contrapeso\r\nNota: Se considera aceptable , tener un tipo de amarre para la cabina y otro distinto para el contrapeso.', 'Grave'),
(137, '6.2', 'Presencia de oxidación en cualquier punto del cable, tal que: -Aun no se presenta perdida de material y/o -Al contacto con el cable se presenta una coloración característica del óxido (Ejemplo amarillo o roja).', 'Leve'),
(138, '6.2', 'Presencia de oxidación en cualquier punto del cable, tal que exista desprendimiento de material o se evidencie de la destrucción paulatina de los hilos constitutivos del cable, por acción de agentes externos.', 'Grave'),
(139, '6.4', 'No existe paracaídas en contrapeso habiendo circulación de personas bajo el foso.', 'Leve'),
(140, '6.5', 'Zapata y/o deslizadera de cabina y/o contrapeso en mal estado (rotas, no existentes, rozando partes metálicas, sueltas o con sujeción incompleta).', 'Grave'),
(141, '6.6', 'Al soporte le faltan tuercas o pasadores.', 'Leve'),
(142, '6.6', 'El paracaídas de contrapeso no actúa (cuando aplica).', 'Muy Grave'),
(143, '6.6', 'Pesas rotas o fracturadas dentro del bastidor, y/o sobresaliendo fuera del bastidor (que incumpla la distancia mínima entre cabina y contrapeso, es decir, < 35 mm.', 'Muy Grave'),
(144, '6.6', 'Existe posibilidad de movimiento de las pesas por ausencia de mecanismos de acuñamiento.', 'Muy Grave'),
(145, '6.6', 'En caso de existir poleas sobre el contrapeso, no disponen de los elementos necesarios para evitar la salida de los cables, (en caso de aflojamiento de éstos y la introducción de cuerpos extraños en las gargantas de las mismas) y/o estos dispositivos impiden las operaciones de inspección o de mantenimiento. ', 'Grave'),
(146, '6.6', 'Para ascensores cuyo contrapeso y cabina estén dentro del mismo pozo, el contrapeso está guiado mediante cables guía.', 'Muy Grave'),
(147, '6.9', 'El paracaídas de contrapeso no actúa (cuando aplica)', 'Muy Grave');
INSERT INTO `ascensor_items_preliminar` (`k_coditem_preli`, `o_descripcion`) VALUES
(1, 'El ascensor a inspeccionar se encuentra libre de grasa, aceite, papel, elementos ajenos al ascensor, diferentes a los utilizados para el mantenimiento del mismo, que representen un riesgo para el inspector y todo personal que pueda participar en la inspección.'),
(2, 'El personal que acompaña a la inspección cumple con los elementos de protección personal.'),
(3, 'Existe llaves para ingreso al cuarto de máquinas y se encuentra presente el personal responsable del mantenimiento del ascensor para el acompañamiento; quien será responsable de efectuar las operaciones necesarias para la inspección.');
