INSERT INTO `escaleras_items_defectos` (`k_coditem_escaleras`, `o_descripcion`, `v_clasificacion`) VALUES
(1, 'Hay acumulación de los materiales en los embarques, (por ejemplo grasa, aceite, polvo, papel) el cual representa un riesgo para la caída de pasajeros.', 'Grave'),
(2, 'Los elementos de la escalera o del andén móvil movidos mecánicamente no están completamente encerrados por paredes o paneles perforados. NOTA 1: se exceptúan los escalones, placas o bandas que son accesibles y la parte de los pasamanos utilizable por el usuario. Se permiten orificios de ventilación. NOTA 2: se permite omitir el cerramiento de los elementos movidos mecánicamente, si otras medidas (tales como locales provistos de puertas, provistas de cerraduras, solo accesibles a personal autorizado) imposibilitan cualquier peligro para el público.', 'Muy Grave'),
(3, 'No es posible acceder y/o ingresar a los embarques.', 'Grave'),
(4, 'Teniendo rejillas de ventilación, es posible introducir una varilla rígida mayor a 10 mm de diámetro a través del cerramiento o tocar cualquier elemento móvil a través de una apertura de ventilación.', 'Muy Grave'),
(5, 'La escalera mecánica supera el Angulo de inclinación a 30°. NOTA: para alturas h13 superior a 6 m y velocidad nominal superior a 0.50 m/s. Se permite, incrementar el Angulo de inclinación a 35°.', 'Muy Grave'),
(6, 'El Angulo de inclinación de los andenes móviles sobrepasa lo 12°.', 'Muy Grave'),
(7, 'Los espacios de maquinaria dentro del bastidor son accesibles sin herramientas a personal no autorizado.', 'Muy Grave'),
(8, 'Las tapas de los embarques están perforadas.', 'Muy Grave'),
(9, 'La superficie pisable de escalón no está horizontal (la gota del nivel esta por fuera de la línea de tolerancia). por NORMA NTC 5846 numeral 5.3.1. debe ser horizontal (0°) +/- 1°', 'Muy Grave'),
(10, 'la superficie pisable para andenes tiene una tolerancia máxima de 3° respecto del Angulo de la rampa, a la entrada o salida de la rampa.', 'Grave'),
(11, 'Existe una diferencia del nivel vertical entre dos escalones consecutivos en la zona  de transporte del usuario (zona plana a la entrada y a la salida superior a 4 mm.', 'Grave'),
(12, 'El deslizamiento lateral de los escalones o placas fuera de su sistema guiado supera 4 mm en cada lado  y 7 mm para la suma de las holguras medidas de ambos lados. El deslizamiento vertical excede los 4 mm para escalones y placas y 6 mm para bandas. Este requisito aplica únicamente en el área útil de los escalones, placas o bandas.', 'Muy Grave'),
(13, 'En caso de andenes móviles de banda continua, los soportes para zona pisable en bandas no están colocados a intervalos a la zona pisable.', 'Grave'),
(14, 'La distancia entre dos escalones consecutivos o placas en cualquier posición utilizable medida en la superficie pisable es mayor a 6 mm (Véase a la figura 2, detalles Y, Z  la figura 5, detalle S y la figura 6, detalle U). Nota en las áreas de las curvas de transición de andenes móviles con bordes delanteros y traseros de las placas encajadas, se permite incrementar esta distancia hasta 8 mm. (véase la figura 6, detalle V).', 'Grave'),
(15, 'No existen demarcaciones (por ejemplo una ranura en la zona pisable del escalón) para remarcar en los rellanos el borde trasero de los escalones.', 'Leve'),
(16, 'La velocidad nominal en vacío se desvía más de un 5% a la frecuencia y voltaje nominal.', 'Leve'),
(17, 'La velocidad nominal en vacío de la escalera mecánica es superior a los siguientes valores: -0.75 m/s para una escalera mecánica con un ángulo de inclinación de hasta 30° -0.50m/s para una escalera mecánica con un Angulo de inclinación entre 30° y 35°.', 'Grave'),
(18, 'Cuando el andén tenga un desplazamiento horizontal en el rellano incluyendo el área de desembarque inferior a 1.60 m sin importar el ancho de la placa o banda; la velocidad nominal de los andenes móviles supera los 0.75 m/s.', 'Grave'),
(19, 'Cuando el andén tenga un desplazamiento horizontal en el rellano superior a 1.60 m y su ancho de placa o banda es inferior a 1.10 m, la velocidad nominal de los andenes móviles supera los 0.90 m/s.', 'Grave'),
(20, 'La apertura del freno electromecánico no se efectúa por acción permanente de una corriente eléctrica, en condiciones normales de operación.', 'Muy Grave'),
(21, 'El funcionamiento del freno no actúa inmediatamente después de abrirse el circuito de freno eléctrico.', 'Muy Grave'),
(22, 'La fuerza del freno no se genera por muelle(s) guiado(s) de compresión.', 'Muy Grave'),
(23, 'La interrupción de la alimentación eléctrica no es efectuada por al menos dos circuitos eléctricos independientes.', 'Muy Grave'),
(24, 'Es posible volver arrancar la escalera o el andén móvil, luego de accionar  uno de los circuitos eléctricos independientes.', 'Muy Grave'),
(25, 'La escalera o anden móvil cuenta con un sistema de acople entre el freno de servicio y el accionamiento de los escalones, placas, o bandas, por medio de elementos de fricción, como una correa plana.', 'Muy Grave'),
(26, 'En caso que la escalera o andén móvil cuenta con freno auxiliar, este no es de tipo mecánico (de fricción).', 'Muy Grave'),
(27, 'En caso de tener freno auxiliar, este no actúa en los siguientes casos: a) antes de que la velocidad supere un valor de 1,4 veces la velocidad nominal; b) en el momento que los escalones y placas de la banda cambie su actual dirección de movimiento.', 'Muy Grave'),
(28, 'En caso de disponer de un dispositivo de maniobra manual, esta no se encuentra accesible y su uso presenta riesgos. Cuando el dispositivo de maniobra manual es extraíble, no se cuenta con un dispositivo eléctrico de seguridad.\n ', 'Grave'),
(29, 'Las distancias de parada de escaleras mecánicas sin carga y bajando con carga, no están comprendidas entre los valores dados en la siguiente tabla.', 'Muy Grave'),
(30, 'Las distancias de frenado para andenes móviles sin carga o para andenes móviles cargados. Ascendiendo o Descendiendo no están dentro de los valores casos por la tabla. Tabla 3. Distancias de parada para andenes móviles.', 'Muy Grave'),
(31, 'Los escalones de la escalera mecánica son accionados por una sola cadena.', 'Grave'),
(32, 'El movimiento de las placas en el área utilizable no es paralelo véase fig.6.', 'Grave'),
(33, 'Las cadenas no están tensionadas.', 'Grave'),
(34, 'Los elementos de la tensión de la banda no quedan sujetos de forma segura si se rompe su suspensión.', 'Grave'),
(35, 'Falta una o las dos balaustradas a cada lado de la escalera mecánica o anden móvil.', 'Muy Grave'),
(36, 'Las balaustradas existentes representan un riesgo para los usuarios (caídas, cortes, obstáculos en viajes, etc.)', 'Grave'),
(37, 'En la parte inclinada, la altura vertical h1 desde la nariz del Escalón o superficie de las placa o banda hasta la zona superior del pasamanos es inferior a 0.90 m o superior a 1.10 m (véanse las figuras 2 y 3).', 'Grave'),
(38, 'Las balaustradas tienen partes sobre las que una persona pueda estar de pie normalmente.', 'Muy Grave'),
(39, 'En el exterior de las balaustradas es posible que una persona se desplace.', 'Muy Grave'),
(40, 'Las partes de las balaustradas frente aros escalones, placas o bandas, no son lisas.', 'Grave'),
(41, 'Los tapajuntas o listones situados en la dirección de marcha sobresalen más de 3 mm, no son suficientemente rígidos y no tienen bordes.', 'Grave'),
(42, 'Las uniones entre las partes que conforman la balaustrada superan los 4 mm de anchura.', 'Grave'),
(43, 'Las faldillas no son verticales, planas ni unidas a topa. NOTA: sin embargo, en el caso de andenes móviles de gran longitud, es posible que se requieran disposiciones especiales en el lugar de la unión a tope, en los lugares donde estos aparatos cruzan las juntas de dilatación de los edificios.', 'Grave'),
(44, 'La distancia perpendicular h2 entre el borde superior de las faldillas o el borde interior de los tapajuntas salientes o la parte rígida de los deflectores y la línea de la nariz de los escalones o de la superficie pisable de las placas o banda, es inferior a 25 mm (véase la figura 3).', 'Grave'),
(45, 'En las escaleras mecánicas, no se reduce la posibilidad de quedar enganchado entre las faldillas y los escalones, además de algunos de los siguientes casos: a) no hay rigidez de las faldillas, b) las distanciadas de separación no cumple con lo siguiente: mayor de 4 mm en cada lado, y 7 mm para la suma de holguras medidas de ambos lados, en dos puntos directamente opuestos.', 'Grave'),
(46, 'Cuando las faldillas de los andenes móviles terminen por encima de las placas o banda, la holgura es mayor de 4 mm, medidos verticalmente desde la superficie pisable.', 'Grave'),
(47, 'Cada balaustrada no ésta provista de un pasamano que se desplace en la misma dirección que los escalones, placas o bandas.', 'Muy Grave'),
(48, 'La velocidad de los pasamano tiene una desviación de velocidad superior o igual al +/- 15% relativa a la velocidad de los escalones, placas o banda bajo condiciones normales de funcionamiento.', 'Muy Grave'),
(49, 'Los perfiles de los pasamanos y sus guías en las balaustradas tienen la posibilidad de que dedos o manos queden pisados o enganchados.', 'Muy Grave'),
(50, 'La distancia entre el perfil de los pasamanos y los perfiles de guiado o revestimiento son superiores a 8 mm de anchura (véase b6 y b6 en la figura 3, detalle w). ', 'Muy Grave'),
(51, 'En el punto de entrada de los pasamanos en la cabeza de la balaustrada, no existe una defensa que evite la posibilidad de atrapamiento de dedos y manos.', 'Muy Grave'),
(52, 'Los pasamanos no están guiados ni tensados de forma que salen de sus guías durante su uso normal.', 'Muy Grave'),
(53, 'En los rellanos, los escalones de la escalera mecánica no entran o salen del peine y los bordes traseros de los escalones que entran en el peine se muevan horizontalmente), y su distancia es menor 1.0 mm.', 'Grave'),
(54, 'En el área de los peines, no existe un correcto encaje de los dientes del peine con las ranuras de la superficie pisable.', 'Grave'),
(55, 'La banda (suelo de algunos andenes móviles) no está sustentada en las áreas de peines de manera adecuada (por ejemplo mediante tambores, rodillos o placas de deslizamiento).', 'Grave'),
(56, 'Los peines no están montados en ambos rellanos para facilitar la tracción de los pasajeros. Los peines no son reemplazables.', 'Muy Grave'),
(57, 'Los extremos de los peines no están redondeados (tienen cantos vivos) y/o están conformados de manera tal, que exista el riesgo que los pasajeros resulten enganchados entre los peines y los escalones, placas o banda.', 'Grave'),
(58, 'La forma e inclinación de los dientes del peine, obstaculizan o atrapan los pies de los pasajeros.', 'Muy Grave'),
(59, 'La profundidad de encaje h8 de los peines en las ranuras de la superficie pisable (véanse la figura 2, detalle x) es inferior a 3.8 mm.La holgura h6 (véanse la figura 2, detalle x) es mayor a 4 mm.', 'Grave'),
(60, 'Recintos par ala maquinaria, estaciones de accionamiento y retorno se utilizan para colocar equipo no necesario para el funcionamiento, mantenimiento o inspección de la escalera mecánica o el andén móvil.', 'Muy Grave'),
(61, 'En los casos en que el armario de maniobra se tenga se tenga que mover o elevar para realizar operaciones de mantenimiento, este no tiene las sujeciones adecuadas para su elevación, (por ejemplo argollas, asas o agarraderas).', 'Leve'),
(62, 'No existe un interruptor de para en las estaciones de accionamiento y retorno.', 'Muy Grave'),
(63, 'El funcionamiento de los interruptores de parada no provoca el corte de alimentación de la máquina de tracción y/o permite que el freno de servicio sea efectivo para detener la escalera mecánica o anden móvil.', 'Muy Grave'),
(64, 'Una ves activado el interruptor de parada, no hay impedimento para que la escalera mecánica o andén móvil pueda ponerse en marcha.', 'Muy Grave'),
(65, 'Las posiciones del interruptor de arranque y para no están marcadas claramente y de manera permanente.', 'Grave'),
(66, 'Las escaleras mecánicas o andenes móviles no están equipadas con maniobra de inspección portátiles y de accionamiento manual que permitan el funcionamiento durante los trabajos de mantenimiento o reparación con conexión en cada embarque.', 'Grave'),
(67, 'Los dispositivos de maniobra no están protegidos contra accionamiento accidental.', 'Muy Grave'),
(68, 'La dirección de la marcha no es claramente reconocible y/o no está identificada por la posición del interruptor.', 'Grave'),
(69, 'Conectados más de un dispositivo de maniobra el equipo funciona.', 'Muy Grave'),
(70, 'El dispositivo de maniobra no tiene interruptor de parada de emergencia (stop).', 'Muy Grave'),
(71, 'El interruptor de parada de emergencia en la unidad de maniobra de inspección a) No es activamente manualmente b) no es de rearme manual c) no interrumpe la alimentación a la máquina y no activa el freno de servicio.', 'Muy Grave'),
(72, 'Algún peine  tiene dos o más dientes consecutivos partidos.', 'Muy Grave'),
(73, 'Ausencia o daño de más del 10% del número total de dientes de los peines de un embarque.', 'Muy Grave'),
(74, 'Existen filtración de agua en los embarques  de las escaleras de uso interior.', 'Grave'),
(75, 'Existe separación mayor a 3 mm (horizontalmente) entre el embarque de la escalera o andén móvil y el piso terminado de la edificación.', 'Grave'),
(76, 'Existe diferencia de altura mayor a 5 mm entre el nivel del embarque de la escalera o andén móvil y el nivel del piso y el nivel del piso terminado de la edificación. Cuando haya una rampa de acceso al embarque (para mitigar el desnivel), el ángulo de inclinación sobre la horizontal es mayor de 20°.', 'Grave'),
(77, 'Presencia de grietas en los puntos de apoyo de la estructura de la escalera o anden móvil. NOTA: la gravedad del defecto es calificada por el inspector del organismo de inspección.', ''),
(78, 'No hay señalización sobre el uso adecuado de la escalera (véase anexo B)', 'Muy Grave'),
(79, 'La altura libre por encima de los escalones de la escalera mecánica o las placas o bandas de los andenes móviles, en todos los puntos, es menor de 2.30 m (véase h4 en las figuras 2 y 8). Esta altura libre se extiende hasta el final de la cabeza de balaustrada.', 'Leve'),
(80, 'No se cumple con el área libre mínima definida alrededor de la escalera mecánica o anden móvil, como se indica en la figura 7, en los siguientes casos: a) la altura H12, medida desde los escalones de la escalera mecánica o desde las placas o banda del andén móvil es menor a 2.10 m. G. b)la distancia desde el borde exterior del pasamanos y muros u otros obstáculos (véase B10 en la figura 7) es inferior a 80 mm en la horizontal y 25 mm en la vertical por debajo del borde inferior del pasamanos (véase B12 en la figura 3).', 'Grave'),
(81, 'En las intersecciones con pisos y en escaleras mecánicas o andenes móviles entrecruzados, no existe sobre del nivel del pasamanos un deflector vertical de altura, inferior a 0.30 m. (por ejemplo un triángulo sin perforaciones y que debe extenderse al menos a 25 mm por debajo del borde inferior del pasamanos (véase H5, en las figuras 2 y 4). En caso que exista el deflector, este presenta un borde afilado cortante. NOTA: no es necesarios cumplir este requisito cuando la distancia b. entre el centro del pasamanos y cualquier obstáculo sea igual o superior a 400 mm (véase la figura 7).', 'Muy Grave'),
(82, 'En las entradas y salidas de las escaleras mecánicas y los andenes móviles, no hay espacio libre suficiente para acomodar a los pasajeros cumpliendo las siguientes medidas: a) al ancho de este espacio libre debe corresponderse, como mínimo, con la distancia entre los centros de los pasamanos más 80 mm por cada lado, G b) La profundidad debe ser como mínimo de 2.50 m medidos desde el final de la balaustrada NOTA: se permite reducir esta dimensión a 2.00 m si el ancho del espacio libre se aumenta hasta al menos el doble de la distancia entre los centros de los pasamanos más 80 mm por cada lado.', 'Grave'),
(83, 'Donde la salida de una escalera mecánica o de un andén está bloqueada por elementos estructurales (por ejemplo contraventanas, puertas anti-incendios); no existe un pulsador de parada adicional para situaciones de emergencia a nivel del pasamanos, a una distancia de entre 2 m y 3 m antes de que el escalón/placa/banda alcance la línea de intersección del peine.', 'Grave'),
(84, 'Este interruptor de emergencia en escalera mecánica o anden móvil bloqueada por elementos estructurales, no es accesible desde dentro de la escalera mecánica o anden móvil.', 'Grave'),
(85, 'No existe barreras permanentes que eviten situaciones de caída sobre la balaustrada, como en el caso que una persona entre el contacto con el borde exterior de los pasamanos en un rellano. (véase la figura 9).', 'Muy Grave'),
(86, 'En escaleras mecánicas o andenes móviles inferiores, la intensidad de u}iluminación es inferior a 50 lux en la línea de intersección del peine midiendo a nivel del suelo.', 'Grave'),
(87, 'Los espacios de maquinaria no está bloqueado y son accesibles a personal no autorizado.', 'Muy Grave'),
(88, 'Los espacios de maquinaria no cuentan con iluminación eléctrica permanente en las siguientes condiciones: - un mínimo de 200 lux a nivel del suelo en las áreas de trabajos; -un mínimo de 50 lux a nivel del suelo en las rutas de acceso a las áreas de trabajo.', 'Grave'),
(89, 'La velocidad de funcionamiento supera un 20% la de la velocidad nominal.', 'Muy Grave'),
(90, 'No existe y/o no funciona ningún dispositivo para detectar rotura o elongación excesiva de componentes de accionamiento de los escalones, placa o banda, (por ejemplo cadenas o cremalleras).', 'Grave'),
(91, 'Una vez activado el dispositivo que detecta rotura o elongación excesiva de componentes de accionamiento de los escalones, el funcionamiento de la escalera o andén móvil es permitido.', 'Muy Grave'),
(92, 'Los dispositivos de seguridad existentes no funcionan o no se encuentran asegurados, permitiendo la extensión o reducción de la distancia entre el dispositivo y su actuador.', 'Muy Grave'),
(93, 'No existen y/o no funciona el dispositivo de seguridad que detiene la escalera o anden móvil, cuando cuerpos extraños son atrapados en la entrada de los pasamanos.', 'Muy Grave');
