INSERT INTO `escaleras_items_preliminar` (`k_coditem`, `o_descripcion`) VALUES
(1, 'El área de la escalera a inspeccionar se encuentra libre de grasa, aceite, papel, diferentes a los utilizados para el mantenimiento del mismo, que representen un riesgo para el inspector y todo personal que pueda participar en la inspección.'),
(2, 'El personal que acompaña a la inspección cumple con los elementos de protección personal.'),
(3, 'Se encuentra presente el personal responsable del mantenimiento de la Escalera eléctrica para el acompañamiento; quien será responsable de efectuar las operaciones necesarias para la inspección.');
