INSERT INTO `puertas_items_maniobras` (`k_coditem_maniobras`, `o_descripcion`, `v_clasificacion`) VALUES
(76, 'Cuando se miden las fuerzas que ejerce una hoja de puerta (base el numeral 5 de la NTC 6009 (En 124445), etas superan 150 N  para la fuerza estática y 400 N para la fuerza dinámica (véase anexo B, punto de medición). Nota para mayor información, véase el anexo A normativo de la NTC 5999 (en 12453).', 'Muy Grave'),
(77, 'No existe evidencia del ensayo establecido en el numeral / de la NTC 6009 (eN 12445) con equipo de detención de presencia.', 'Grave'),
(78, 'No existe evidencia del ensayo establecido en el anexo C, normativo de la presente norma, mediante equipos electro-sensitivos y/o equipo de protección sensible a la presión.', 'Grave'),
(79, 'La puerta (cuando está diseñada de forma que abre hacia arriba y no es accionada por el modo de presión mantenida) puede levantar a un adulto o a un niño de forma peligrosa. Esto se verifica con el siguiente ensayo: la puerta es capaz de levantar masa de 20Kg ( o de 40Kg en caso de puertas instaladas en zonas accesibles al público), a partir de la posición cerrada la masa debe estar fija sobre la hoja de puerta en la posición más desfavorable, la dimensión máxima de la masa debe ser de 300 mm en cualquier dirección.', 'Muy Grave'),
(80, 'En el caso de puertas que funcionen bajo un control de presión mantenida, se presenta riesgo para las personas generando por el impacto de la hoja en movimiento.', 'Grave'),
(81, 'En caso de puertas que no funcionan bajo un control de presión mantenida, no existe iluminación de al menos 50 lux en la zona donde está instalada la puerta, que permita cualquier movimiento en la oscuridad.', 'Leve'),
(82, 'En caso de puertas que no funcionan bajo un control de presión mantenida, no existe señalización para informar a los usuarios del funcionamiento automático.', 'Leve'),
(83, 'En caso de puertas que no funcionen bajo control de presión mantenida, no hay sirenas instaladas, o no hay señales luminosas para regular el tráfico de vehículos.', 'Grave'),
(84, 'En caso de puertas que no funcionen bajo control de presión mantenida, no están instalados los dispositivos suplementarios que aseguran una detención anticipada de los vehículos, dando así a la hoja tiempo para invertir el sentido del movimiento.', 'Grave'),
(85, 'Al realizar procedimiento de abrir y cerrar completamente 10 veces con la velocidad de maniobra definida, se presenta alteración en las dimensiones o en la forma, así como deformaciones o desgaste Nota véase numerales 5.1.1 de la NTC 5715 (en 12605).', 'Grave'),
(86, 'Al realizar el procedimiento de detener la hoja de puerta 10 veces en diferentes posiciones durante 5 maniobras de apertura y cierre (para puertas motorizadas cortar la alimentación del mecanismo de maniobra) la hoja de puerta no permanece en reposo tras cortar la alimentación del mecanismo de maniobra. Nota véase el numeral 5.1.4 de la NTC 5715 (en 12605).', 'Grave');
INSERT INTO `puertas_items_mecanicos` (`k_coditem_puertas`, `o_descripcion`, `v_clasificacion`) VALUES
(1, 'No se cumplen las holguras, las distancias de seguridad ni las medidas de protección establecidas en la figura 1 a 11.', 'Grave'),
(2, 'Existen elementos cortantes (vidrios sin pulir, aristas, vivas, entre otros) en las hojas de la puerta.', 'Muy Grave'),
(3, 'Las partes de los bordes de las barreras sensibles a la presión tienen aristas agudas o ángulos susceptibles de herir a las personas que se encuentran en contacto con el dispositivo.', 'Muy Grave'),
(4, 'Es posible accede al mecanismo sin un a llave o herramienta.', 'Grave'),
(5, 'Se evidencia oxidación o corrosión, o ambas, en más de 20% del área de las hojas o el marco de la puerta o ambas.', 'Leve'),
(6, 'Las hojas de la puerta, las bisagras o los marcos están deformadas y afectan el funcionamiento normal de la puerta.', 'Muy Grave'),
(7, 'Las poleas están desalineadas respecto al cable.', 'Leve'),
(8, 'Las poleas están sin engrasar.', 'Grave'),
(9, 'Los muelles o los resortes del freno fisurados, deformados, partidos u oxidados.', 'Grave'),
(10, 'Las bisagras están sueltas.', 'Grave'),
(11, 'Los cojinetes fisurados o partidos.', 'Grave'),
(12, 'Se evidencia deformación en la guía y topes.', 'Grave'),
(13, 'Las guías de deslizamiento de la hoja móvil presentan cortes, interrupciones o ambas.', 'Grave'),
(14, 'Se evidencia oxidación en cualquier punto del cable, tal que existe desprendimiento del material o se evidencia la destrucción paulatina de los hilos construidos del cable, por acción de agentes externos.', 'Grave'),
(15, 'Los cables de alambre de acero no son accesibles para inspección y mantenimiento a lo largo de todas u longitud.', 'Grave'),
(16, 'Existen empales en los cables.', 'Grave'),
(17, 'Se evidencia falla en la sucesión de los sujetos cables.', 'Grave'),
(18, 'Existen puntos de soldadura sueltos.', 'Grave'),
(19, 'Existen remaches sueltos.', 'Grave'),
(20, 'Se evidencia la falta de elasticidad en cauchos protectores o presencia de rotura o ambos.', 'Grave'),
(21, 'La puerta presenta pérdida de estabilidad, caída de piezas, caída de la hoja.', 'Muy Grave'),
(22, 'Existe de arrastre, enganche o corte, o ambos, provocados por la forma de la hoja móvil.', 'Grave'),
(23, 'En los sistemas de suspensión que lleva correas, estas no son accesibles para la inspección.', 'Grave'),
(24, 'No existen medios para prevenir que las correas se desenganchen accidentalmente.', 'Grave'),
(25, 'En puertas hidráulicas, no existen medios para proteger los equipos de las sobrepresiones, ni medios para permitir la conexión de un dispositivo de medición.', 'Grave'),
(26, 'No existen dispositivos como manivelas, manijas o tiradores de cuerdas, sobre la parte interna y/o externa de la puerta que facilite su movimiento en caso de maniobra manual.', 'Grave'),
(27, 'Los dispositivos como manivelas, manijas o tiradores de cuerdas, presenta riesgos de que las personas y/o sus vestidos queden sujetos en cualquier forma, cuando se pasa a través de una puerta eléctrica.', 'Grave'),
(28, 'Las guías o recorridos no están cubiertas por guarniciones apropiadas, hasta una altura de 2.5 m por encima del nivel del suelo u otro nivel de acceso permanente.', 'Grave'),
(29, 'La entrada de los contrapesos no es segura de sus cubiertas.', 'Grave'),
(30, 'Existe movimiento involuntario y peligroso de la hoja de la puerta, si falla un elemento suspensión de contrapeso.', 'Grave'),
(31, 'Existe peligro para el edificio o personas en sus proximidades, por consecuencia de la caída del contrapeso.', 'Grave'),
(32, 'No hay fijación segura de los medios de suspensión.', 'Grave'),
(33, 'Es posible el desplazamiento accidental del contrapeso .', 'Grave'),
(34, 'Las cadenas que llevan los sistemas de suspensión no son accesibles para la inspección y el mantenimiento a lo largo de toda su longitud.', 'Grave'),
(35, 'No existen medios para prevenir que la cadena se desenganche accidentalmente de los piñones.', 'Grave'),
(36, 'No está prevista una protección de los piñones de la cadena o de sus puntos de enganche a menos de 2.5 m por encima del nivel del suelo.', 'Grave'),
(37, 'La hoja de puerta no permanece en los rieles o elementos de guía y estos muestran cualquier deformación permanente, que afecta su función y otros efectos negativos.', 'Grave');
INSERT INTO `puertas_items_motorizacion` (`k_coditem_motorizacion`, `o_descripcion`, `v_clasificacion`) VALUES
(43, 'La puerta no se detiene automáticamente, cuando alcanza sus posiciones límite de final de recorrido.', 'Muy Grave'),
(44, 'El movimiento de la puerta no se interrumpe y/o la motorización no se pone fuera del funcionamiento cuando se le da la orden de parada.', 'Grave'),
(45, 'En las puertas de rejas persianas enrollables, no se detiene la hoja ni la motorización, y/o se presenta falla en el sistema de suspensión. (La hoja se descuelga por gravedad).', 'Muy Grave'),
(46, 'Existe posibilidad de que queden personas atrapadas en las zonas en las que una puerta motorizada sea la única salida posible, incluso en falla de la motorización o de la alimentación de energía.', 'Muy Grave'),
(47, 'Se presenta falla en los anclajes del motor.', 'Muy Grave'),
(48, 'Falta la coraza en los cableados.', 'Grave'),
(49, 'Hay presencia de aceite derramado.', 'Muy Grave'),
(50, 'Las puertas motorizadas no están protegidas contra los contactos eléctricos directos e indirectos.', 'Grave'),
(51, 'Se evidencia falla en el control de accesos para activar sistema de apertura o cierre de la puerta.', 'Muy Grave'),
(52, 'La motorización o la fuente de energía utilizada para el funcionamiento motorizado evidencia recalentamiento (aislantes derretidos, decoloración, entre otros).', 'Leve'),
(53, 'La motorización o la fuente de energía utilizada para el funcionamiento motorizado presenta riesgo de choque eléctrico (cables sin aislantes o dañados, elementos eléctricos descubiertos y expuestos al usuario, entre otros). ', 'Muy Grave'),
(54, 'En caso de falla de la motorización o de la alimentación de energía, y si la puerta es el único medio de salida, la persona atrapada no tiene la posibilidad de deslizar manualmente la hoja, desconectando la motorización de la hoja de puerta o accionado la motorización por medio de medios accesibles. ', 'Grave');
INSERT INTO `puertas_items_otras` (`k_coditem_otras`, `o_descripcion`, `v_clasificacion`) VALUES
(55, 'Se evidencia presencia de grietas en la estructura donde están ubicados los puntos de apoyo de la puerta eléctrica. Nota. La gravedad del defecto es calificada por el inspector.', ''),
(56, 'Hay acumulación de materiales que obstaculizan la entrada o salida de la puerta, (por ejemplo grasa, aceite, tierra).', 'Grave'),
(57, 'En caso de puertas transparentes, no existe una banda opaca a lo largo de la vidriera, o mediante un adorno u otro elemento decorativo. Nota para mayor información, consultar el código de sismo resistencia, numeral K4.3.9.1.', 'Grave'),
(58, 'Cuando se coloca una banda opaca de visibilidad en una puerta trasparente, esta tiene menos de 20 mm de alto y está localizada, de tal manera que la distancia vertical desde el nivel del piso sea - No menor de 700 mm hasta el borde superior de la banda. - No más de 1000 mm hasta el borde inferior de la banda.', 'Grave'),
(59, 'La banda colocada en la puerta transparente no es fácilmente visible. Nota 1 - La visibilidad se logra ya empleado una banda que contraste con el fondo o incrementando el ancho de la banda. Nota 2 - Las líneas discontinuas con diseños discontinuos son formas aceptables de bandas de adherencia. Nota 3 - No se requiere bandas ni marcas en los siguientes casos; la altura del panel de vidrio no supera los 1000 mm en ninguna dimensión, - el ancho del panel del vidrio no supera los 500 mm de ninguna de sus dimensiones (incluye paneles individuales con vidrios a tope), - El panel de vidrio se ha entregado con al menos un perfil firmemente asegurado. Para proteger cada una de las caras del vidrio. Al menos uno de los perfiles está colocado con su borde superior a menos de 500 mm y su borde interior a menos de 1000 mm sobre el nivel del piso. El ancho de la cara del perfil no es menor a 40 mm.', 'Grave'),
(60, 'Las puertas auxiliares no se pueden abrir cuando la puerta principal está en posición cerrada.', 'Muy Grave'),
(61, 'Cerradura de puertas auxiliares se encuentran inoperantes.', 'Muy Grave'),
(62, 'Existe peligro de que la puerta funciones en la modalidad de hombre presente. (Cuando ese sistema exista).', 'Muy Grave'),
(63, 'Las puertas que se abren a zonas de tráfico no disponen de un medio para la observación.', 'Muy Grave'),
(64, 'Se provocan movientes involuntarios o incontrolados de la hoja de la puerta debido a influencias externas, tales como viento o agua entre otros.', 'Leve'),
(65, 'Se presentan movimiento de la hoja de puerta (apertura o cierre) que hacen que las personas o los objetos queden atrapados o se aplasten en cualquier posición.', 'Grave'),
(66, 'Existe riesgo de arrastre, enganche y/o corte a los usuarios provocados por la forma de la hoja móvil.', 'Grave'),
(67, 'Faltan instrucciones apropiadas dirigidas a las personas responsables para la operación y uso (ejemplo, administración o vigilancia, entre otros).', 'Grave'),
(68, 'Hay peligro de tropiezo en caso de una existencia de alfombras y suelos sensibles a la presión. La distancia entre las juntas y las uniones de las alfombras y el suelo circundante es superior a 3 mm.', 'Grave'),
(69, 'Existe separación mayor a 3 mm (horizontal) entre el terminado de la puerta (marco o riel) y el piso terminado de la identificación.', 'Grave'),
(70, 'En caso de existencia de dispositivos de advertencia (sonoro-luminoso), estos no funcionan.', 'Grave'),
(71, 'No existen o no funciona el equipo de detención de presencia.', 'Grave'),
(72, 'En puertas verticales no existe el dispositivo anti-caída.', 'Muy Grave'),
(73, 'En puertas verticales, al aplicar el dispositivo anti-caída, la hoja de la puerta no se detiene automáticamente dentro de la distancia de 300 mm y además, puede ser movida más Asia abajo. ', 'Grave'),
(74, 'Es posible que las personas queden atrapadas en las zonas comprendidas entre dos puertas motorizadas (por ejemplo vestíbulos, exclusas) o en habitaciones en la que la única salida posible es una puerta motorizada (por ejemplo, garajes para un solo automóvil).', 'Muy Grave'),
(75, 'No existe una empresa encargada del mantenimiento ni conservación del aparato, la cual haga que conste un registro de mantenimiento (contrato bitácora, reporte técnico o acta de mantenimiento, entre otros).', 'Grave');
INSERT INTO `puertas_items_preliminar` (`k_coditem`, `o_descripcion`) VALUES
(1, 'El área de la Puerta Eléctrica automática a inspeccionar se encuentra libre de grasa, aceite, papel, diferentes a los utilizados para el mantenimiento del mismo, que representen un riesgo para el inspector y todo personal que pueda participar en la inspección.'),
(2, 'El personal que acompaña a la inspección cumple con los elementos de protección personal.'),
(3, 'Existe llaves para abrir guarniciones y se encuentra presente el personal responsable del mantenimiento de la puerta eléctrica para el acompañamiento; quien será responsable de efectuar las operaciones necesarias para la inspección.');
